    reg0=reg1+reg0; reg3=reg5-reg3; T reg6=0.5*nodes[3]->pos[1]; reg2=reg1-reg2; reg1=0.5*nodes[3]->pos[0];
    reg5=reg4+reg5; reg0=reg0-reg6; reg6=reg2+reg6; reg3=reg1+reg3; reg1=reg5-reg1;
    reg6=reg1*reg6; reg3=reg0*reg3; T det_jac=reg6-reg3;

